import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { useEffect } from "react";
import { useState } from "react";
import  retrieveCaughtPokemonAction  from "../actions/catchPokemonAction";

const MyPokemon = ({ retrieveCaughtPokemonAction, userId }) => {
  const [pokemonCaught, setPokemonCaught] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const data = await retrieveCaughtPokemonAction(userId);
      setPokemonCaught(data);
    };

    fetchData();
  }, [retrieveCaughtPokemonAction, userId]);

  return (
    <div>
      <h1>My Pok√©mon</h1>
      <ul>
        {pokemonCaught.map((pokemon) => (
          <li key={pokemon._id}>
            {pokemon.caught_by_user}
            {pokemon.pokemon_name}
            {pokemon.url_to_sprite};
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MyPokemon;
